  const [bad, setBad] = useState(0)

  return (
    <div>
      <h1>Give feedback</h1>
      <button>Good</button>
      <button>Neutral</button>
      <button>bad</button>
    </div>
  )
}

ReactDOM.render(<App />, 
  document.getElementById('root')
